      </FadeIn>
      </div>
    }

      {this.state.ready &&
      <Router>
      <Switch>
      <Route path="/login">
      <Login />
    </Route>
    </Switch>
    <Redirect to='/login' />

    </Router>

      }


      </div>
      );
  }

}

export default App;
